import { useContext } from 'react';
import { AppContext } from '../components/context/appContext.js';
import { SearchBar } from '../components/forms/searchBar.js';
import ResultComp from '../components/resultComp.js';

export default function Search(){
    const {
    foundUsers
    } = useContext(AppContext)

    return(
        <div className='p-3 pt-4 pr-6 pl-6 pb-10 grid grid-cols-1 content-center text-center'>
            <span className='text-left'> Find a friend </span>
            <SearchBar/>
            <ResultComp
            foundUsers={foundUsers}/>
        </div>
    )
}
